requirement_description:
(1) Maintain the web platform that houses PSNet.
(2) Provide a library of carefully selected, annotated resources on patient safety for multiple audiences;
(3) Serve as a coordinating and national link to the latest news on patient safety and essential, relevant
domestic and international, public and private sector patient safety resources and information;
(4) Maintain, monitor, and enhance a national, web-based learning program for health care providers;
(5) Advance learning about patient safety by providing annotated links to patient safety information
and downloadable material based on monthly WebM&M cases and offering continuing education
credits,
(6) Develop and maintain appropriate partnerships to enhance and expand the content availability of
PSNet
